Двухкомпонентный кислотостойкий эпоксидный состав для укладки и затирки керамической плитки и мозаики с шириной шва от 1 до 15 мм
Характеристики:
EpoxyElite — двухкомпонентный кислотостойкий эпоксидный затирочный состав. Компонент А состоит из смеси эпоксидных смол, кремниевых заполнителей и добавок. Компонент B является отвердителем. После смешивания компонентов А и B получается состав, который может использоваться в качестве клея для плитки или затирки межплиточных швов.
EpoxyElite соответствует классу RG, R2T.
Сфера применения:
EpoxyElite может применяться для:
•	внутренних и наружных работ;
•	вертикальных и горизонтальных поверхностей;
•	влажных помещений;
•	поверхностей и швов с высокими требованиями химической стойкости к щелочам, кислотам и другим агрессивным веществам;
•	предприятий пищевой промышленности;
•	террас, балконов, цоколей и фасадов зданий;
•	полов с водяным и электрическим подогревом.

