Готовый к использованию эластичный жидкий гидроизоляционный состав с очень быстрым высыханием для внутренних и наружных гидроизоляционных работ.

Область применения:

Создание гидроизоляционного слоя перед укладкой покрытий из керамической плитки, камня и мозаики:

• на балконах и террасах;

• в ванных комнатах и душевых;

• в прачечных;

• в саунах и влажных помещениях.

Основания:

• бетон;

• цементные стяжки и стяжки на основе специальных вяжущих;

• гипсокартонные перегородки (только в помещениях);

• существующие покрытия из керамики, тераццо и камня;

• цементные штукатурки.
