Однокомпонентная полимерная масса для устройства эластичных водонепроницаемых покрытий под плиточные облицовки

Гидроизоляционная масса CL 51 предназначена для устройства эластичных водонепроницаемых покрытий перед устройством плиточных облицовок в помещениях, подверженных периодическому увлажнению (ванных, душевых, туалетах, кухнях и т.д.).

СВОЙСТВА
готова к применению;
легко наносится кистью, валиком или шпателем;
экспресс решение - укладка плитки через 6 часов;
эластичная;
перекрывает трещины раскрытием до 0,75 мм;
может применяться на стяжках с подогревом и на гипсокартоне;
жёлтый индикатор цвета для контроля нанесения;
пригодна только для внутренних работ;
не содержит растворителей;
экологически безопасна.

Резиновая лента между двумя слоями нетканого полотна для создания эластичных швов в системах гидроизоляции. Mapeband Easy эластичная и деформируемая и имеет ряд отверстий по краям для улучшения смачиваемости при нанесении гидроизоляции. Mapeband Easy используется в сочетании с различными гидроизоляционными материалами, например, из линеек Mapelastic, Monolastic, Mapegum WPS.

Область применения:

•             Гидроизоляция углов примыкания «стена – стена» и «пол – стена»;

•             Эластичная гидроизоляция деформационных швов на террасах, балконах и т.д.

Преимущества:

•             Высокая эластичность с удлинением при разрыве более 300%;

•             Простое нанесение благодаря отверстиям по краям ленты;

•             Бесшовные наружные слои из нетканого полотна позволяют создавать швы между различными участками ленты непосредственно с помощью гидроизоляционного материала;

•             Возможность обработки выбранным гидроизоляционным составом или клеем, используемым при приклеивании напольного/ настенного покрытия.

