Гидроветрозащитная пленка НОВИТЕКС А изготавливается из плотного полипропилена. Данное изделие применяется при обустройстве фасадов и скатной кровли. Пленка гидроветрозащитная НОВИТЕКС А применяется для защиты внутренних элементов стен, кровель от атмосферного воздействия (влага, ветер, конденсат). Материал способствует выводу паров из утеплителя и защищает его от выдувания тепла. Используется пленка в конструкциях каркасных стен, при устройстве мансардных этажей, чердачных перекрытий и вентилируемых фасадов.
Чтобы подобрать изоляционные пленки определенного назначения, перейдите в категорию Диффузионные мембраны и отметьте в фильтре необходимые значения.
Преимущества:
обеспечивает защиту от влаги и ветра;
прочная; длительный срок эксплуатации;
способствует выведению влаги.
